sys_variable_value.value:
(function execute(inputs, outputs) {
  var cfy_integartion = new cloudify_integration();
  // convert inputs array object to dict
  var parameters = {};
  for (var i = 0; i < inputs.parameters.length; i++) {
    var variable = inputs.parameters[i];
    if (variable.parameter_name!='' && variable.parameter_value!='')
    	parameters[variable.parameter_name] = variable.parameter_value;
  }
  // format YYYYMMDDHHMM+HHMM
  var schedule = '';
  if(inputs.schedule){
    var dt= new GlideDateTime(inputs.schedule);
    schedule = dt.getDate().toString().replaceAll('-','')+dt.getTime().getByFormat('HHmmZ');  
  }
  outputs.result = cfy_integartion.startExecution(inputs.config_name, inputs.deployment_id, inputs.workflow_id, inputs.allow_custom_parameters, parameters, inputs.force, inputs.queue, schedule);

})(inputs, outputs);

